package Collection.Account;public class Account {    int accNo;    String accNmae;    double balence;    public Account(int no,String anm,Double bal){        this.accNo=no;        this.accNmae=anm;        this.balence=bal;    }    @Override    public String toString() {        return "Account Number- "+accNo+"\nAccount name- "+accNmae+"\nTotal Balence- "+balence;    }}